Write a Groovy program that uses a linked list data structure to implement a stack. The program should be able to perform the following stack operations: push (add an element to the top of the stack), pop (remove and return the top element from the stack), and peek (return the top element without removing it). Use object-oriented programming principles to design your implementation. Show your work and explain your design decisions.

Solution:Here's a possible implementation of a Stack class in Groovy using a linked list data structure:

    public class Stack<T> {

        private Node head;

        public static class Node {
            private T data;
            private Node next;

            public Node(T data) {
                this.data = data;
            }
        }

        public void push(T item) {
            Node newNode = new Node(item);

            if (head == null) {
                head = newNode;
            } else {
                newNode.next = head;
                head = newNode;
            }
        }
